import React from 'react';
import '../global.css';

const Navbar = () => {
  return (
    <nav style={{
      width: '100%',
      background: '#181818',
      color: '#fff',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'space-between',
      padding: '0.75rem 2rem',
      position: 'fixed',
      top: 0,
      left: 0,
      zIndex: 1000,
      boxShadow: '0 2px 16px 0 rgba(0,0,0,0.08)'
    }}>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        <img src={require('../assets/logo.png')} alt="Logo" className="logo" style={{ marginRight: '1rem' }} />
        <span style={{ fontFamily: 'Helvetica Bold, Helvetica, Arial, sans-serif', fontWeight: 'bold', fontSize: '1.4rem', letterSpacing: '1px' }}>
          YourBrand
        </span>
      </div>
      <div style={{ display: 'flex', gap: '2rem', alignItems: 'center' }}>
        <a href="/" style={{ fontFamily: 'Helvetica Bold, Helvetica, Arial, sans-serif', fontWeight: 'bold', fontSize: '1rem' }}>Home</a>
        <a href="#pricing" style={{ fontFamily: 'Helvetica Bold, Helvetica, Arial, sans-serif', fontWeight: 'bold', fontSize: '1rem' }}>Pricing</a>
        <a href="/profile" style={{ fontFamily: 'Helvetica Bold, Helvetica, Arial, sans-serif', fontWeight: 'bold', fontSize: '1rem' }}>Profile</a>
      </div>
    </nav>
  );
};

export default Navbar;
